import React from 'react'
import CheckoutProduct from './CheckoutProduct'

function Order(order) {
    return (
        <div>
            <h2>Order</h2>
            <p>{order.id}</p>
            {order.data.basket?.map(item=>{
                <CheckoutProduct 
                id={item.id} 
                title={item.title} 
                image={item.image} 
                price={item.price}
                rating={item.rating} />
            })}
        </div>
    )
}

export default Order
